// GetJingWei 输入省名称　市或者县名称　后面空显示省的坐标
func GetJingWei(xname, subname string) (float64, float64) {
	var j, w float64
	for name, arr := range CityMap {
		if strings.HasPrefix(name, xname) {
			for i := 0; i < len(arr); i++ {
				if strings.HasPrefix(arr[i].Name, subname) {
					j = arr[i].Longitude
					w = arr[i].Latitude
					break
				}
			}
			break
		}
	}
	return j, w
}
